bool load_bundled_certs(X509_STORE* store) {
  bool loaded = false;

  for (auto [length, data] : certificates) {
    auto x509 = d2i_X509(NULL, (const unsigned char**)&data, length);
    if (x509) {
      X509_STORE_add_cert(store, x509);
      X509_free(x509);
      loaded = true;
    }
  }

  return loaded;
}

